import Brush from "./Brush";

export default class Eraser extends Brush {
    static draw(ctx: any, x: number, y: number) {
        ctx.strokeStyle = "white"
        console.log(ctx)
        ctx.lineTo(x, y)
        ctx.stroke()
    }
}
